import { LOGIN, CARD_INFO, SUCCESS } from "./Constants";

export const Login_action = (user)=>{
    return {
        type  : LOGIN,
        user

    }
}


export const Get_card_info = (card, card_number, multichoice_type) => ({
         type: CARD_INFO,
         card,
         card_number,
         multichoice_type,
       });


export const Successful = (wallet, phone, network, Ref, amount) =>({
    type: SUCCESS,
    wallet,
    phone,
     network,
      Ref,
      amount
})
